import logo from './logo.svg';
import './App.css';
import { Route, Router, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './components/Home';

function App() {
  return (
    <div className='container-fluid  body'>
      <Navbar />
      <Home/>
      <Routes>
        <Route path='' element={ <Home/>} />
      </Routes>
 </div>
  );
}

export default App;
